import React, { Component } from "react";
import {
  AiFillFacebook,
  AiFillInstagram,
  AiFillLinkedin,
  AiFillTwitterSquare,
} from "react-icons/ai";

class Footer extends Component {
  state = {};
  render() {
    return (
      <div>
        <div className="social-container">
          <h1>Social Follow</h1>
          <a className="social">
            <AiFillFacebook
              size={50}
              style={{
                color: "#4968ad",
              }}
            />
          </a>
          <a className="social">
            <AiFillInstagram
              size={50}
              style={{
                color: "black",
              }}
            />
          </a>
          <a className="social">
            <AiFillTwitterSquare
              size={50}
              style={{
                color: "#49a1eb",
              }}
            />
          </a>

          <a className="social">
            <AiFillLinkedin
              size={50}
              style={{
                color: "blue",
              }}
            />
          </a>
        </div>
      </div>
    );
  }
}

export default Footer;
